import React from "react";
import { ReactDOM } from "react";
//Create portal
const Modal = () => {
  if (typeof document === "undefined")
    return ReactDOM.createPortal(
      <div className="modal"></div>,
      document.querySelector("body")
    );
};

export default Modal;
